import React, { Component } from 'react'
import {Timeline, Events, UrlButton, ImageEvent, TextEvent} from '@merc/react-timeline';

export class TimelineElement extends Component {
  render() {
    return (
        <div id="timeline">
        <Timeline>
          <Events>
          {this.props.data ? this.props.data.map(d =>
            <ImageEvent date={d ?d.date : 'loading'} text={d ?d.text : 'loading'}
            src="https://res.cloudinary.com/dovoq8jou/image/upload/v1564772194/jellyfish.jpg"
            alt="jellyfish swimming"
            credit="Photo by [@tavi004](https://unsplash.com/@tavi004)"
              href="https://unsplash.com/search/photos/undersea"
            />
          ): 'loading'}
             <div>
               <UrlButton href="https://unsplash.com/search/photos/undersea">
                 View more undersea photos
               </UrlButton>
             </div>

           </Events>
         </Timeline>
   </div>
    )
  }
}

export default TimelineElement
